{"payload":{"allShortcutsEnabled":true,"fileTree":{"":{"items":[{"name":"CovidDeaths.xlsx","path":"CovidDeaths.xlsx","contentType":"file"},{"name":"CovidVaccinations.xlsx","path":"CovidVaccinations.xlsx","contentType":"file"},{"name":"Covid_Project.sql","path":"Covid_Project.sql","contentType":"file"},{"name":"README.md","path":"README.md","contentType":"file"}],"totalCount":4}},"fileTreeProcessingTime":1.944545,"foldersToFetch":[],"reducedMotionEnabled":"system","repo":{"id":696968288,"defaultBranch":"main","name":"Portfolio_Projects","ownerLogin":"lb0201","currentUserCanPush":true,"isFork":false,"isEmpty":false,"createdAt":"2023-09-26T15:28:21.000-04:00","ownerAvatar":"https://avatars.githubusercontent.com/u/129354909?v=4","public":true,"private":false,"isOrgOwned":false},"symbolsExpanded":false,"treeExpanded":false,"refInfo":{"name":"main","listCacheKey":"v0:1696364769.0","canEdit":true,"refType":"branch","currentOid":"4911c915d5e02cb7309d2b62d6e3bccb537ff2f2"},"path":"Covid_Project.sql","currentUser":{"id":129354909,"login":"lb0201","userEmail":"sk2blue0201@gmail.com"},"blob":{"rawLines":["/**\r","COVID-19 Data Analysis\r","**/\r","\r","--Select All Data\r","SELECT *\r","FROM PortfolioProject..CovidDeaths\r","WHERE continent IS NOT NULL\r","ORDER BY 3,4\r","\r","\r","-- Select Data that going to be used\r","\r","SELECT Location, date, total_cases, new_cases, total_deaths, population\r","FROM PortfolioProject..CovidDeaths\r","ORDER BY 1,2\r","\r","-- Total Cases vs Total Deaths\r","-- Death rate of COVID in South Korea\r","   \r","SELECT Location, date, total_cases, total_deaths, (total_deaths/total_cases)*100 AS DeathPercentage\r","FROM PortfolioProject..CovidDeaths\r","WHERE location LIKE '%korea%'\r","ORDER BY 1,2\r","\r","-- Total Cases vs population\r","-- Percentage of the population infected with Covid in South Korea\r","\r","SELECT Location, date, population, total_cases, (total_cases/population)*100 AS PercentPopulationInfected\r","FROM PortfolioProject..CovidDeaths\r","WHERE location LIKE '%korea%'\r","ORDER BY 1,2\r","\r","-- Countries with the Highest Infection Rate compared to the Population\r","\r","SELECT Location, population, MAX(total_cases) AS highestInfectionCount, MAX((total_cases/population))*100 AS PercentPopulationInfected\r","FROM PortfolioProject..CovidDeaths\r","GROUP BY location, population\r","ORDER BY PercentPopulationInfected DESC\r","\r","--Countries with the Highest Death Count per Population\r","\r","SELECT Location, MAX(CAST(Total_deaths AS int)) AS TotalDeathCount\r","FROM PortfolioProject..CovidDeaths\r","WHERE continent IS NOT NULL\r","GROUP BY location\r","ORDER BY TotalDeathCount DESC\r","\r","\r","--BREAKING THINGS DOWN BY CONTINENT\r","\r","-- Showing continents with the highest death count per population\r","\r","SELECT continent, MAX(CAST(Total_deaths AS int)) AS TotalDeathCount\r","FROM PortfolioProject..CovidDeaths\r","WHERE continent IS NOT NULL\r","GROUP BY continent\r","ORDER BY TotalDeathCount DESC \r","\r","\r","\r","-- GLOBAL NUMBERS\r","\r","SELECT SUM(new_cases) AS total_cases, SUM(CAST(new_deaths AS int)) AS total_deaths, SUM(CAST(new_deaths AS int))/SUM(new_cases) * 100 AS DeathPercentage\r","FROM PortfolioProject..CovidDeaths\r","--WHERE continent like '%korea%'\r","WHERE continent IS NOT NULL\r","--Group by date\r","ORDER BY 1,2\r","\r","\r","-- Total Population vs Vaccinations\r","-- Shows Percentage of Population that has received at least one COVID-19 vaccine\r","   \r","SELECT dea.continent, dea.location, dea.date, dea.population, vac.new_vaccinations\r",", SUM(CONVERT(int, vac.new_vaccinations)) OVER (Partition BY dea.location ORDER BY dea.location, dea.Date) AS RollingPeopleVaccinated\r","--,(RollingPeopleVaccinated/population)*100\r","FROM PortfolioProject..CovidDeaths dea\r","JOIN PortfolioProject..CovidVaccinations vac \r","         ON dea.location = vac.location \r","         AND dea.date = vac.date\r","WHERE dea.continent IS NOT NULL\r","ORDER BY 2,3\r","\r","\r","\r","--USE CTE to perform Calculation on Partition By in the previous query\r","\r","WITH PopvsVac (Continent, Location, Date, Population, New_Vaccinations, RollingPeopleVaccinated)\r","AS\r","(\r","SELECT dea.continent, dea.location, dea.date, dea.population, vac.new_vaccinations\r",", SUM(CAST(vac.new_vaccinations AS int)) OVER (Partition BY dea.location ORDER BY dea.location, dea.Date) AS RollingPeopleVaccinated\r","--,(RollingPeopleVaccinated/population)*100\r","FROM PortfolioProject..CovidDeaths dea\r","JOIN PortfolioProject..CovidVaccinations vac \r","ON dea.location = vac.location AND dea.date = vac.date\r","WHERE dea.continent IS NOT NULL\r","--order by 1,2,3\r",")\r","SELECT *, (RollingPeopleVaccinated/Population)*100\r","FROM PopvsVac\r","\r","\r","\r","\r","\r","--TEMP TABLE to perform calculation By in previous query\r","\r","DROP TABLE IF EXISTS #PercentPopulationVaccinated\r","CREATE TABLE #PercentPopulationVaccinated\r","(\r","Continent nvarchar(255),\r","Location nvarchar(255),\r","Date datetime,\r","Population numeric,\r","New_vaccination numeric,\r","RollingPeopleVacinated numeric\r",")\r","\r","\r","INSERT INTO #PercentPopulationVaccinated\r","SELECT dea.continent, dea.location, dea.date, dea.population, vac.new_vaccinations\r",", SUM(CONVERT(int, vac.new_vaccinations)) OVER (Partition BY dea.location ORDER BY dea.location, \r","dea.Date) AS RollingPeopleVaccinated\r","--,(RollingPeopleVaccinated/population)*100\r","FROM PortfolioProject..CovidDeaths dea\r","JOIN PortfolioProject..CovidVaccinations vac \r","   ON dea.location = vac.location \r","   AND dea.date = vac.date\r","--where dea.continent is not null\r","--order by 1,2,3\r","\r","SELECT *, (RollingPeopleVacinated/Population)*100\r","FROM #PercentPopulationVaccinated\r","\r","-- Creating View to store data for later visualization\r","\r","CREATE VIEW percentPopulationVaccinated AS\r","SELECT dea.continent, dea.location, dea.date, dea.population, vac.new_vaccinations\r",", SUM(CONVERT(int, vac.new_vaccinations)) OVER (Partition BY dea.location ORDER BY dea.location, \r","dea.Date) AS RollingPeopleVaccinated\r","--,(RollingPeopleVaccinated/population)*100\r","FROM PortfolioProject..CovidDeaths dea\r","JOIN PortfolioProject..CovidVaccinations vac \r","         ON dea.location = vac.location \r","         AND dea.date = vac.date\r","WHERE dea.continent IS NOT NULL\r","\r","\r","SELECT *\r","FROM percentPopulationVaccinated\r"],"stylingDirectives":[[{"start":0,"end":3,"cssClass":"pl-c"},{"start":0,"end":2,"cssClass":"pl-c"}],[{"start":0,"end":22,"cssClass":"pl-c"}],[{"start":0,"end":3,"cssClass":"pl-c"},{"start":1,"end":3,"cssClass":"pl-c"}],[],[{"start":0,"end":17,"cssClass":"pl-c"},{"start":0,"end":2,"cssClass":"pl-c"}],[{"start":0,"end":6,"cssClass":"pl-k"},{"start":7,"end":8,"cssClass":"pl-k"}],[{"start":0,"end":4,"cssClass":"pl-k"}],[{"start":0,"end":5,"cssClass":"pl-k"},{"start":16,"end":27,"cssClass":"pl-k"}],[{"start":0,"end":8,"cssClass":"pl-k"},{"start":9,"end":10,"cssClass":"pl-c1"},{"start":11,"end":12,"cssClass":"pl-c1"}],[],[],[{"start":0,"end":36,"cssClass":"pl-c"},{"start":0,"end":2,"cssClass":"pl-c"}],[],[{"start":0,"end":6,"cssClass":"pl-k"},{"start":17,"end":21,"cssClass":"pl-k"}],[{"start":0,"end":4,"cssClass":"pl-k"}],[{"start":0,"end":8,"cssClass":"pl-k"},{"start":9,"end":10,"cssClass":"pl-c1"},{"start":11,"end":12,"cssClass":"pl-c1"}],[],[{"start":0,"end":30,"cssClass":"pl-c"},{"start":0,"end":2,"cssClass":"pl-c"}],[{"start":0,"end":37,"cssClass":"pl-c"},{"start":0,"end":2,"cssClass":"pl-c"}],[],[{"start":0,"end":6,"cssClass":"pl-k"},{"start":17,"end":21,"cssClass":"pl-k"},{"start":63,"end":64,"cssClass":"pl-k"},{"start":76,"end":77,"cssClass":"pl-k"},{"start":77,"end":80,"cssClass":"pl-c1"},{"start":81,"end":83,"cssClass":"pl-k"}],[{"start":0,"end":4,"cssClass":"pl-k"}],[{"start":0,"end":5,"cssClass":"pl-k"},{"start":15,"end":19,"cssClass":"pl-k"},{"start":20,"end":29,"cssClass":"pl-s"},{"start":20,"end":21,"cssClass":"pl-p